--  Cosmology Functions
-- THIS SCRIPT UPLOADS COSMOLOGICAL AND STATISTICAL FUCNTIONS AND 
-- PROCEDURES INTO A DATABASE. THE COSMOLOGICAL PARAMETERS CAN BE
-- SPECIFIED BY THE USER OR ARE JUST ALREADY GIVEN AS DEFAULT VALUES
-- In this version, the cosmological parameters are treated as input.
-- If you weant to know the best values for them, take a look at:
--
--   The cosmological parameters were obtained from the abstract
--   (or Table 6) in the following paper:
--   "Five-Year Wilkinson Microwave Anisotropy Probe (WMAP) 
--   Observations:Data Processing, Sky Maps, & Basic Results",
--   Hinshaw et al. 2008, which can be downloaded here:
--   http://lambda.gsfc.nasa.gov/product/map/dr3/pub_papers/fiveyear/basic_results/wmap5basic.pdf
--   (These parameters come from a combination of WMAP+BAO+SN results)
--   
--   See also this other paper for a better review of the parameters and equations:
--   "FIVE-YEAR WILKINSON MICROWAVE ANISOTROPY PROBE (WMAP1) OBSERVATIONS:COSMOLOGICAL INTERPRETATION" 
--   from 
--   http://lambda.gsfc.nasa.gov/product/map/dr3/pub_papers/fiveyear/cosmology/wmap_5yr_cosmo.pdf  
--    
--    Note: 
--    Since OmegaK is very close to zero, the value of OmegaM has been
--    changed slightly, such that we have 
--       OmegaM + OmegaL +OmegaK + OmegaR = 1.
--       OmegaL=0.721+-0.015
--       h_0=0.701+-0.013
--       0.0175 < OmegaK < 0.0085 -> OmegaK~0.0
--    
--       OmegaGamma*h_0^2=2.469e-5 -> OmegaGamma=5.0244e-5
--       OmegaR = OmegaGamma*(1+0.2271*Neff) 
--          where Neff=effective number of neutrinos.
--       Neff=4.4+-1.5 from 2nd paper, but I will use instead the
--       standard value Neff=3.04
--       Then OmegaR = 8.493e-5
--
--       OmegaM*h_0^2=0.1369+-0.0037 -> OmegaM=0.2785912117... ->
--       OmegaM~1-0.721-8.493e-5 =  0.27891507
--
--   The parameter "omega0" that defines the Dark Energy equation of state at z=0 is set to -1
--
-----------------------------------------------------------------
--* 2008-10-30 Ani: Incorporated into sqlLoader2k5.
--* 2008-11-07 Ani: Updated with latest version from Manu 
--*                 (distance modulus function added too).
--* 2010-08-24 Ani: Deleted actualy assembly binary string from commented out
--*            ALTER ASSEMBLY command.  This was causing an error in loader.
--* 2010-12-10 Ani: Deleted spMath* functions due to problems creating them.
