CREATE FUNCTION fCosmoZfromDl( @LuminosityDistance float, @OmegaM float=0.27891507, @OmegaL float=0.721, @OmegaR float=8.493e-5, @omega0 float=-1, @h_0 float=0.701)
----------------------------------------------------------------
--/H Returns the redshift at a given luminosity distance.<br>
--/U ------------------------------------------------------------
--/T Parameters:<br>
--/T <li> @LuminosityDistance float: luminosity distance in Mpc.
--/T <li> @OmegaM float: matter density. If set as DEFAULT, then 0.27891507
--/T <li> @OmegaL float: dark energy density. If set as DEFAULT, then 0.721
--/T <li> @OmegaR float: radiation density. If set as DEFAULT, then 8.493e-5
--/T <li> @omega0 float: dark energy state equation. If set as DEFAULT, then -1
--/T <li> @h_0 float: (hubble constant[Km/s/MPc])/(100[Km/s/MPc]). If set as DEFAULT, then 0.701
--/T Reference:
--/T http://lambda.gsfc.nasa.gov/product/map/dr3/pub_papers/fiveyear/cosmology/wmap_5yr_cosmo.pdf <br>
--/T <li> returns redshift float
--/T <br><samp> select dbo.fCosmoZfromDl(460.365188862815,0.27891507,0.721,8.493e-5,-1,0.701);select dbo.fCosmoZfromDl(460.365188862815,DEFAULT,DEFAULT,DEFAULT,DEFAULT,DEFAULT) </samp>
--/T <br> return 0.1 and 0.1
--/T <br> see also fCosmoDl

RETURNS float
AS EXTERNAL NAME [CosmologyCASJOBS].[SQLCosmology.SQLCosmologyFunctionsFreeParameters].[RedshiftAtLuminosityDistance]
GO

