create function fCosmoZfromDa( @AngularDiamDist float, @OmegaM float=0.27891507, @OmegaL float=0.721, @OmegaR float=8.493e-5, @omega0 float=-1, @h_0 float=0.701)
----------------------------------------------------------------
--/H Returns a row with the first and second solution for the redshift, given an angular diameter distance.<br>
--/U ------------------------------------------------------------
--/T Parameters:<br>
--/T <li> @AngularDiamDist float: angular diameter distance in Mpc.
--/T <li> @OmegaM float: matter density. If set as DEFAULT, then 0.27891507
--/T <li> @OmegaL float: dark energy density. If set as DEFAULT, then 0.721
--/T <li> @OmegaR float: radiation density. If set as DEFAULT, then 8.493e-5
--/T <li> @omega0 float: dark energy state equation. If set as DEFAULT, then -1
--/T <li> @h_0 float: (hubble constant[Km/s/MPc])/(100[Km/s/MPc]). If set as DEFAULT, then 0.701
--/T Reference:
--/T http://lambda.gsfc.nasa.gov/product/map/dr3/pub_papers/fiveyear/cosmology/wmap_5yr_cosmo.pdf <br>
--/T <li> returns table (z1 float, z2 float): one row table where z1 and z2 are the first and second solutions, and z1<=z2.
--/T <br><samp> select * from dbo.fCosmoZfromDa(380.467098233731,0.27891507,0.721,8.493e-5,-1,0.701); select * from dbo.fCosmoZfromDa(380.467098233731,DEFAULT,DEFAULT,DEFAULT,DEFAULT,DEFAULT) </samp>
--/T <br> return the rows 0.0999999999999999	29.5344556200345 and 0.0999999999999999	29.5344556200345
--/T <br> see also fCosmoDa
returns TABLE (z1 float , z2 float)
AS EXTERNAL NAME [CosmologyCASJOBS].[SQLCosmology.SQLCosmologyFunctionsFreeParameters].[RedshiftAtAngularDiamDist]
GO

