create function fCosmoQuantities(@zMin float, @zMax float, @NumBin int, @OmegaM float=0.27891507, @OmegaL float=0.721, @OmegaR float=8.493e-5, @omega0 float=-1, @h_0 float=0.701)
----------------------------------------------------------------
--/H Returns a table of redshifts and the corresponding values of the cosmological distances,comoving volume and time intervals.<br>
--/U ------------------------------------------------------------
--/T Parameters:<br>
--/T <li> @zMin float: redshift lower bound
--/T <li> @zMax float: redshift upper bound
--/T <li> @NumBin int: number of bins, at whose boundaries all the values are evaluated. Number of rows returned = @NUmBin + 1.
--/T <li> @OmegaM float: matter density. If set as DEFAULT, then 0.27891507
--/T <li> @OmegaL float: dark energy density. If set as DEFAULT, then 0.721
--/T <li> @OmegaR float: radiation density. If set as DEFAULT, then 8.493e-5
--/T <li> @omega0 float: dark energy state equation. If set as DEFAULT, then -1
--/T <li> @h_0 float: (hubble constant[Km/s/MPc])/(100[Km/s/MPc]). If set as DEFAULT, then 0.701
--/T Reference:
--/T http://lambda.gsfc.nasa.gov/product/map/dr3/pub_papers/fiveyear/cosmology/wmap_5yr_cosmo.pdf <br>
--/T <li> returns table (z float, Dc float, Dm float, Da float, Dl float, Dh float, ComVol float, LookBackTime float, AgeOfUniverse float) where
--/T <li> z: redshift 
--/T <li> Dc: line of sight comoving distance in MPc.
--/T <li> Dm: transverse comoving distance in MPc. 
--/T <li> Da: angular diameter distance in MPc.
--/T <li> Dl: luminosity distance in MPc.
--/T <li> Dh: hubble distance in MPc.
--/T <li> ComVol: comoving volume in GPc^3.
--/T <li> LookBackTime: look back time at z in GYr.
--/T <li> AgeOfUniverse: age of the universe at z in GYr.
--/T <br><samp> select * from fCosmoQuantities(0,5,1000,0.27891507,0.721,8.493e-5,-1,0.701);select * from fCosmoQuantities(0,5,1000,DEFAULT,DEFAULT,DEFAULT,DEFAULT,DEFAULT) </samp>
returns TABLE (z float, Dc float, Dm float, Da float, Dl float, Dh float, ComVol float, LookBackTime float, AgeOfUniverse float)
AS EXTERNAL NAME [CosmologyCASJOBS].[SQLCosmology.SQLCosmologyFunctionsFreeParameters].[GridAllCosmoQuantitiesIEnumerable]
GO


