create function fMathGetBin(@x float, @x1 float, @x2 float , @NumBin int, @HasOpenUpperBound bit)
----------------------------------------------------------------
--/H Returns the value at the center of the bin where @x falls in, given a grid of @NumBin bins in the interval @x1 to @x2.<br>
--/U ------------------------------------------------------------
--/T Parameters:<br>
--/T <li> @x float: value of the variable.
--/T <li> @x1 float: lower bound of the interval.
--/T <li> @x2 float: upper bound of the interval.
--/T <li> @NumBin int: number of bins in which the inteval is partitioned.
--/T <li> @HasOpenUpperBound bit: true if the bins have open upper bounds (and closed lower bounds); false if the bins have open lower bounds (and closed upper bounds).
--/T <li> returns BinCenter float: the center of the bin, where @x falls in. 
--/T <br><samp> select dbo.fMathGetBin( s.z,0.1,0.7,24,0) as BinCenter, count(*) as Counts from SpecPhoto as s where primtarget&(0x04000020)!=0 and primtarget&(64|128|256)=0 and z between 0.1 and 0.7 group by dbo.fMathGetBin(s.z,0.1,0.7,24,0) order by dbo.fMathGetBin(s.z,0.1,0.7,24,0) </samp>
--/T <br> see also spMathHistogramNDim
returns float
AS EXTERNAL NAME [CosmologyCASJOBS].[SQLMathCLR.SQLMathFunctions].[GetBin]
GO

